F5App.app.controller("headerController",["$scope","$rootScope",function(a,b){a.setActive=function(){window.location.href.match("reservaciones")||window.location.href.match("admin")?angular.element("#mainNav .reservaciones").addClass("active"):window.location.href.match("galeria")?angular.element("#mainNav .galeria").addClass("active"):angular.element("#mainNav .home").addClass("active")}}]);